import React from 'react'

const ProfileStatusWithHooks =(props) => {



        return(
            <div>
                {
                <div>
                    <span>{`Status: ${props.status}`}</span>
                </div>
                }
                {true &&
                <div>
                    <input value={props.status}/>
                </div>
                }
            </div>
        )
    }


export default ProfileStatusWithHooks
